@Mike_Pence is the one who started the riot not Trump. I was there. After hearing Trump speak and walking toward the capitol I got Pence's tweet. Shortly thereafter we learned he was going to coward out. 

@bfristThat is when the anger started growing and for some perhaps was too much to bear. It was not Antifa that penetrated the capitol. That's a lie. It was some Trump supporters who took it too far. I was there.

@bfristWhen Satan came to @Mike_Pence he found cowardice and treason. What he didn't find was the Holy Spirit. Because phony church goers are not born again. So it didn't take the Devil much arm twisting. And just like that the direction of the country nose dived.

@bfristIf not then what other situation or event would trigger sending it to the States but legitimate claims of voter fraud? The Constitution did its job in this situation. It was man who let us down.

